import React, { useState } from 'react';
import Button from './component/button';

function App() {
  const [text,settext] = useState(0)
  const Increase = ()=>{
   settext(text + 1)
  }
  const Decrease = ()=>{
    settext(text-1)
  }
  return (
    <div>
      <p>{text}</p>
<button  onClick={Increase}>Increase me!</button>
<button  onClick={Decrease}>Decrease me!</button>
<Button/>
</div>
  );
}

export default App;
